import './style.scss';
import {withRouter} from 'next/router'
import React from 'react';

class Sider extends React.Component{
    render(){
        return(
            <div className="sider-box">
                <h1>sider</h1>
            </div> 
        ) 
    }
}

export default withRouter(Sider)
